import React, { Component } from "react";
import Background from './donor.jpg';
import {
    NavLink,
    HashRouter
  } from "react-router-dom";
import LoginService from "../services/LoginService";



class Donor extends Component{
    constructor(props) {
        super(props)

        this.state = {
                Donor: []
        }
        this.addDonor = this.addDonor.bind(this);
        this.listalldonor = this.listalldonor.bind(this);
        this.updatealldonor = this.updatealldonor.bind(this);
    }
    addDonor(){
        
        this.props.history.push('/addDonor');
    }
    listalldonor(){
        LoginService.getallDonor().then(resp => {
            console.log(resp.data);
            // if(resp.status === 200){
             // this.props.history.push('/allDonor');
            })
        }
            // else{

            
    updatealldonor(){
        this.props.history.push('/updateDonor');
    }

    render() {
        return (
            
                
    

                <HashRouter>
<div 
       style={{
              background: `url(${Background})`,
            }}
    >...


                <div>
                <br></br>
                <ul className="header"> 
                    <li><NavLink exact to="/Donor">Donor</NavLink></li>
                    <li><NavLink to ="/search">Search Donor</NavLink></li>
                    <li><NavLink to ="/Stock">Stock</NavLink></li>
                    <li><NavLink to ="/DeleteDonor">Delete Donor</NavLink></li>
                    <li><NavLink to ="/">LogOut</NavLink></li>
                </ul> 
                {/* <h2>Here you can perform all crud operations</h2> */}
                <br></br>
                     <div 
                       style={{
                               display: "flex",
                               justifyContent: "center",
                               alignItems: "center"
                              }}>
                    
                <button className="Container" onClick={this.addDonor}> Add Donor</button>
                <button className="Container" onClick={this.listalldonor}> All Donor</button>
                <button className="Container" onClick={this.updatealldonor}> Update Donor List</button>
                </div>
                </div>
                </div>
                </HashRouter>
        );
    }
}
export default Donor
